import React, { useState } from 'react';
import { User, Package, CreditCard, LogOut } from 'lucide-react';

export default function Account() {
  const [activeTab, setActiveTab] = useState('profile');

  const renderTabContent = () => {
    switch (activeTab) {
      case 'profile':
        return (
          <div>
            <h2 className="text-2xl font-bold text-[#355F2E] mb-4">Profile Information</h2>
            <form>
              <div className="mb-4">
                <label htmlFor="name" className="block text-[#355F2E] mb-2">Name</label>
                <input type="text" id="name" className="w-full p-2 border border-[#A8CD89] rounded-md" defaultValue="John Doe" />
              </div>
              <div className="mb-4">
                <label htmlFor="email" className="block text-[#355F2E] mb-2">Email</label>
                <input type="email" id="email" className="w-full p-2 border border-[#A8CD89] rounded-md" defaultValue="john@example.com" />
              </div>
              <button className="bg-[#355F2E] text-white py-2 px-4 rounded-md hover:bg-[#A8CD89] transition-colors">
                Update Profile
              </button>
            </form>
          </div>
        );
      case 'orders':
        return (
          <div>
            <h2 className="text-2xl font-bold text-[#355F2E] mb-4">Order History</h2>
            <div className="bg-[#F4E0AF] p-4 rounded-md mb-4">
              <p className="font-bold text-[#355F2E]">Order #12345</p>
              <p className="text-[#355F2E]">Date: May 15, 2023</p>
              <p className="text-[#355F2E]">Total: $59.98</p>
              <p className="text-[#355F2E]">Status: Delivered</p>
            </div>
            <div className="bg-[#F4E0AF] p-4 rounded-md">
              <p className="font-bold text-[#355F2E]">Order #12346</p>
              <p className="text-[#355F2E]">Date: June 2, 2023</p>
              <p className="text-[#355F2E]">Total: $45.99</p>
              <p className="text-[#355F2E]">Status: Processing</p>
            </div>
          </div>
        );
      case 'payment':
        return (
          <div>
            <h2 className="text-2xl font-bold text-[#355F2E] mb-4">Payment Methods</h2>
            <div className="bg-[#F4E0AF] p-4 rounded-md mb-4">
              <p className="font-bold text-[#355F2E]">Visa ending in 1234</p>
              <p className="text-[#355F2E]">Expiry: 12/2025</p>
              <button className="text-red-500 hover:text-red-700 mt-2">Remove</button>
            </div>
            <button className="bg-[#355F2E] text-white py-2 px-4 rounded-md hover:bg-[#A8CD89] transition-colors">
              Add New Payment Method
            </button>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div className="w-full bg-white">
      <section className="py-16">
        <div className="container mx-auto px-4">
          <h1 className="text-3xl font-bold text-[#355F2E] mb-8">My Account</h1>
          <div className="flex flex-col md:flex-row gap-8">
            <div className="md:w-1/4">
              <nav className="space-y-2">
                <button
                  onClick={() => setActiveTab('profile')}
                  className={`flex items-center w-full p-2 rounded-md ${
                    activeTab === 'profile' ? 'bg-[#355F2E] text-white' : 'text-[#355F2E] hover:bg-[#F4E0AF]'
                  }`}
                >
                  <User className="w-5 h-5 mr-2" />
                  Profile
                </button>
                <button
                  onClick={() => setActiveTab('orders')}
                  className={`flex items-center w-full p-2 rounded-md ${
                    activeTab === 'orders' ? 'bg-[#355F2E] text-white' : 'text-[#355F2E] hover:bg-[#F4E0AF]'
                  }`}
                >
                  <Package className="w-5 h-5 mr-2" />
                  Orders
                </button>
                <button
                  onClick={() => setActiveTab('payment')}
                  className={`flex items-center w-full p-2 rounded-md ${
                    activeTab === 'payment' ? 'bg-[#355F2E] text-white' : 'text-[#355F2E] hover:bg-[#F4E0AF]'
                  }`}
                >
                  <CreditCard className="w-5 h-5 mr-2" />
                  Payment Methods
                </button>
                <button
                  className="flex items-center w-full p-2 rounded-md text-red-500 hover:bg-red-100"
                >
                  <LogOut className="w-5 h-5 mr-2" />
                  Logout
                </button>
              </nav>
            </div>
            <div className="md:w-3/4">
              {renderTabContent()}
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}
